import React from 'react'
import DateInput from '../../components/ui/DateInput'
import SelectInput from '../../components/ui/SelectInput'
import TextInput from '../../components/ui/TextInput'
import useFormContext from '../../Hooks/useFormContext'

const PersonalInfo = () => {
  const { userData, handleChange, commonInputSetContainerClasses } = useFormContext()

  const sexOptions = [
    ["", ""], ["Male", "male"], ["Female", "female"], ["Non-binary", "non-binary"], ["Prefer not to answer", "None"]
  ]
  const raceOptions = [
    ["", ""], ["White", "white"], ["Black or African American", "black"], ["Native American (American Indian)", "native-american"], ["Asian", "asian"], ["Native Hawaiian and Other Pacific Islander", "pacific-islander"], ["Other", "other"]
  ]

  return (
    <div className="flex flex-col w-full h-[500px]">
      <div className={commonInputSetContainerClasses}>
        <TextInput containerClass=""
          labelText="Country of Origin"
          fieldName="countryOfOrigin"
          fieldValue={userData.countryOfOrigin}
          handleChange={handleChange}
        />
        <DateInput containerClass=""
          labelText="Date of Birth"
          fieldName="dateOfBirth"
          max="2007-01-01"
          fieldValue={userData.dateOfBirth}
          handleChange={handleChange}
        />
      </div>
      <div className={commonInputSetContainerClasses}>
        <SelectInput containerClass=""
          labelText="Sex"
          fieldName="sex"
          fieldValue={userData.sex}
          handleChange={handleChange}
          options={sexOptions}
        />
        <SelectInput containerClass=""
          labelText="Race"
          fieldName="race"
          fieldValue={userData.race}
          handleChange={handleChange}
          options={raceOptions}
        />
      </div>
    </div>
  )
}

export default PersonalInfo
